import React from "react";
import Card from "../../components/Card";
import { Grid } from "@chakra-ui/layout";

function Products() {
  return (
    <div>
      <Card></Card>

      <Grid templateColumns="repeat(3, 1fr)" gap={6}>
      <Card></Card>
      </Grid>
    </div>
  );
}

export default Products;
